- input: "TEXT\x1CC00010439\x1CX0\x1C\x1CF3XA\x1CThis amendment responds to FEC letter
    dated February 18, 2011.  Issue 1.  All disbursements on Schedule B Line 30(b)
    that are identical to disbursements disclosed on Schedule F are correct.  These
    expenditures are hybrid expenditures.  The portion of the expenditure reported
    on Schedule F is the portion allocated to expenditures in connection with the
    general election campaign of Walt Minnick.  The remaining portion of the expenditures
    is Federal Elections Activity expenditures not allocable to a federal candidate.
    \ See FEC advisory opinion 2006-11.    Issue 2. Line 29 discloses a negative entry
    to disclose the return to Idaho Democratic Party of a check to be cancelled that
    had been paid to Myers Research and Strategic Services for an erroneous invoice.
    \ The original expenditure was recorded on Line 29 in the prior period, and this
    negative entry results in the correct year to date amount.  Issue 3.  Disbursements
    on Schedule F for Contract Labor, Contractual Wages, and Contract Wages have been
    clarified to describe the specific purpose.    All employee salaries, benefits,
    payroll taxes, insurance, and reimbursed expenses for employees who spend >25%
    of the month on Federal election activities are paid entirely with Federal funds
    and the expenses are reported on Line 30(b).  All other employee costs are shared
    Federal/Non Federal activities.                                                                                                          \n"
